            "नीर एप्लिकेशन का उपयोग पानी की गुणवत्ता का निर्धारण करने के लिए किया जाता है, जिसमें FUI सूचकांक, टर्बिडिटी, क्लोरोफिल और SPM मूल्यों जैसे मानकों का अनुमान शामिल है। इन मानकों को कैमरे से तस्वीर खींचकर मापा जाता है, और तापमान, pH, गहराई, घुलित ऑक्सीजन, चालकता और सेची गहराई जैसे मानकों को उपकरणों के माध्यम से मैन्युअल रूप से मापा जाता है। इससे पहले, उपयोगकर्ता को जीपीएस या मैन्युअल रूप से स्थान सेट करना होगा, और उसके आधार पर, अक्षांश और देशांतर के मान आसानी से प्राप्त किए जा सकते हैं। जल निकाय का चयन करने के बाद, उपयोगकर्ता उस जल निकाय के संबंधित मानकों का चयन कर सकता है। FUI सूचकांक पानी की छवि को कैप्चर करके पानी का सूचकांक रंग निर्धारित करता है। नीर एक सरल उपयोग इंटरफ़ेस प्रदान करता है जो उपयोगकर्ताओं को तीन छवियों - ग्रे कार्ड छवि, आकाश छवि, और पानी की छवि - के संग्रह में मार्गदर्शन करता है। नीर में 18% फोटोग्राफर ग्रे कार्ड का उपयोग संदर्भ के रूप में आवश्यक है। ग्रे कार्ड फोटोग्राफी की दुकानों और ऑनलाइन उपलब्ध हैं। एक बार छवियां ली जाती हैं, तो उनका विश्लेषण तुरंत किया जा सकता है। छवियों के विश्लेषण में, नीर पानी के शरीर के परावर्तन को कैमरे के RGB रंग चैनलों में गणना करता है। इसके बाद यह परावर्तन मूल्यों का उपयोग पानी की टर्बिडिटी को NTU (नेफेलोमेट्रिक टर्बिडिटी यूनिट्स) में निर्धारित करने के लिए करता है। सेची डिस्क एक गोल सफेद डिस्क है जिसे पानी की सतह से गहराई में डुबोया जाता है, ताकि वह गहराई मापी जा सके जहां पानी सतह से दिखाई नहीं देता है। सेची गहराई पानी की स्पष्टता मापने के लिए उपयोग की जाती है।"),
